class Index extends React.Component {

    render(){
        return (
            <div>
            <h1>Index Page</h1>
            <Link href="/">
                <a> Home </a>
            </Link>
            <Link href="/about">
                <a> About </a>
            </Link>
            <Link href="/blog">
                <a> Blog </a>
            </Link>
            <Link href="/cv">
                <a> CV </a>
            </Link>
            </div>

        )
    }
}

export default Index
